  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112348 includes chemical,
  discrete sample, physical and profile data collected from Hakuho Maru in the North
  Pacific Ocean from 2003-09-30 to 2003-10-17 and retrieved during cruise KH03-2 and
  PACIFICA_49HH20030930. These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY,
  SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these data include
  CTD, Coulometer for DIC measurement and bottle. These data were collected by Nobuo
  Tsurushima of Advanced Industrial Science and Technology and Isao Koike of Tokyo
  University; Ocean Research Institute as part of the PACIFICA_49HH20030930 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
